// Simulated API calls with delays
const simulateApiCall = <T>(data: T, delay: number = 800): Promise<T> => {
  return new Promise((resolve) => {
    setTimeout(() => resolve(data), delay);
  });
};

// API functions
export const fetchRestaurants = async (): Promise<Restaurant[]> => {
  return simulateApiCall(mockRestaurants);
};

export const fetchRestaurantById = async (id: string): Promise<Restaurant | undefined> => {
  const restaurant = mockRestaurants.find(r => r.id === id);
  return simulateApiCall(restaurant);
};

export const fetchMenuItems = async (restaurantId: string): Promise<MenuItem[]> => {
  const menuItems = mockMenuItems.filter(item => item.restaurantId === restaurantId);
  return simulateApiCall(menuItems);
};

// Custom hooks for data fetching
export const useRestaurants = () => {
  return useQuery({
    queryKey: ['restaurants'],
    queryFn: fetchRestaurants
  });
};

export const useRestaurant = (id: string) => {
  return useQuery({
    queryKey: ['restaurant', id],
    queryFn: () => fetchRestaurantById(id),
    enabled: !!id
  });
};

export const useMenuItems = (restaurantId: string) => {
  return useQuery({
    queryKey: ['menuItems', restaurantId],
    queryFn: () => fetchMenuItems(restaurantId),
    enabled: !!restaurantId
  });
};

// Order related functions
const getRandomOrderStatus = (): Order['status'] => {
  const statuses: Order['status'][] = ['pending', 'confirmed', 'preparing', 'out_for_delivery', 'delivered'];
  return statuses[Math.floor(Math.random() * 4)]; // Randomly pick one of the first 4 statuses
};

export const createOrder = async (
  userId: string,
  items: { id: string; name: string; price: number; quantity: number }[],
  restaurantId: string,
  restaurantName: string,
  total: number,
  deliveryAddress: string,
  paymentMethod: string
): Promise<Order> => {
  // In a real app, this would make an API call to your backend
  const order: Order = {
    id: `order_${Math.random().toString(36).substring(2, 15)}`,
    userId,
    items,
    restaurantId,
    restaurantName,
    status: 'pending',
    total,
    createdAt: new Date().toISOString(),
    estimatedDeliveryTime: `${30 + Math.floor(Math.random() * 30)} mins`,
    deliveryAddress,
    paymentMethod
  };
  
  // Simulate storing in localStorage for now
  const existingOrders = JSON.parse(localStorage.getItem('orders') || '[]');
  localStorage.setItem('orders', JSON.stringify([...existingOrders, order]));
  
  return simulateApiCall(order, 1500);
};

export const getOrderById = async (orderId: string): Promise<Order | undefined> => {
  // In a real app, this would fetch from your API
  const orders: Order[] = JSON.parse(localStorage.getItem('orders') || '[]');
  const order = orders.find(o => o.id === orderId);
  
  if (order) {
    // If the order exists, randomly update its status for demo purposes
    if (order.status !== 'delivered') {
      order.status = getRandomOrderStatus();
      localStorage.setItem('orders', JSON.stringify(orders));
    }
  }
  
  return simulateApiCall(order);
};

export const useOrderStatus = (orderId: string) => {
  return useQuery({
    queryKey: ['order', orderId],
    queryFn: () => getOrderById(orderId),
    enabled: !!orderId,
    refetchInterval: 5000, // Poll every 5 seconds to simulate real-time updates
  });
};

// Custom hook to track order in localStorage (simulating backend)
export const useOrderTracking = (orderId: string) => {
  const [orderStatus, setOrderStatus] = useState<Order | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchOrderStatus = async () => {
      try {
        setLoading(true);
        const order = await getOrderById(orderId);
        if (order) {
          setOrderStatus(order);
          setError(null);
        } else {
          setError("Order not found");
        }
      } catch (err) {
        setError("Failed to fetch order status");
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchOrderStatus();
    const interval = setInterval(fetchOrderStatus, 5000);
    
    return () => clearInterval(interval);
  }, [orderId]);

  return { orderStatus, loading, error };
};
